import React from "react";

const PSO = () => {
    return (
        <div>
            <div className="h-[10rem] bg-gray-100 dark:bg-gray-800">
                <div className="container mx-auto px-6 py-10 ">
                    <h1 className="text-center text-3xl font-semibold capitalize text-gray-800 dark:text-white lg:text-4xl">particle swarm optimization </h1>
                    <p className="mx-auto mt-6 max-w-2xl text-center text-gray-500 dark:text-black">La optimización de enjambre de partículas (PSO) se 
                    presenta como un algoritmo de búsqueda global aleatoria, enmarcado dentro del ámbito de la inteligencia de enjambre, y fue concebido 
                    por Kennedy y Eberhart, quienes se inspiraron en la migración y comportamiento de enjambres de animales en busca de alimentos. 
                    Este método, introducido por primera vez en 1995, se basa en el principio de emular el comportamiento social observado en la naturaleza,
                     particularmente en bandadas de aves y bancos de peces.</p>
                </div>
            </div>
        </div>
    );
}
export default PSO;
